import React from 'react';
import Step from "./Step"

function App() {
    
    const [isClicked, setIsClicked] = useState(false);
      
    function toggleClick() {
        setIsClicked(!isClicked);
    }

    return (
        <div>
            <div>
                <Step toggleClick={toggleClick} title="Step 1: Your Details"/>
                <Step toggleClick={toggleClick} title="Step 2: More Comments"/>
                <Step toggleClick={toggleClick} title="Step 3: Final Comments"/>
            </div>
        </div>
    )
}

export default App;
